-- Seed sentiment and theme results for the last 45 days (analytics_db).
-- Dates use CURRENT_DATE at run time (same as seed-journal-45.sql). Re-run this after re-running the journal seed.
-- IMPORTANT: Use the SAME user_id as your logged-in account (and as in seed-journal-45.sql).
-- 1. Replace ea4b5be7-1d22-46f0-97cf-86025ec07056 with your actual user UUID.
-- 2. Run migrations first if needed: analytics-add-emotions.sql, analytics-add-entry-created-at.sql
-- 3. Run: psql -h localhost -p 5433 -U analytics -d analytics_db -f scripts/seed-analytics-45.sql

SET timezone = 'UTC';

ON CONFLICT (id) DO UPDATE SET
  entry_id = EXCLUDED.entry_id,
  user_id = EXCLUDED.user_id,
  score = EXCLUDED.score,
  label = EXCLUDED.label,
  emotions = EXCLUDED.emotions,
  entry_created_at = EXCLUDED.entry_created_at,
  computed_at = EXCLUDED.computed_at;

ON CONFLICT (id) DO UPDATE SET
  entry_id = EXCLUDED.entry_id,
  user_id = EXCLUDED.user_id,
  themes = EXCLUDED.themes,
  entry_created_at = EXCLUDED.entry_created_at,
  computed_at = EXCLUDED.computed_at;
